import React from 'react'
import { GoogleMap , withScriptjs , withGoogleMap} from 'react-google-maps';

function Map(){
    return(
        <GoogleMap defaultZoom = {10} 
        defaultCenter = {{lat : 46.770920 , lng : 23.589920}}/>
    );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

const Footer = () =>{
    return(
        <div className = "footer-main">
            <div className = "footer-grid">
                <div className = "footer-grid-item">
                    <h1 className = "footer-header">About Us</h1>
                    <h1 className = "about-text">Italian cuisine is a Mediterranean cuisine consisting of the ingredients, recipes and cooking techniques developed across the Italian Peninsula since antiquity, and later spread around the world together with waves of Italian diaspora.Our restaurant does it all with pride and succes!</h1>
                </div>
                <div className = "footer-grid-item">
                    <h1 className = "footer-header">Navigation</h1>
                    <div class = "footer-navigation-links">
                        <a className = "footer-link">HOME</a>
                        <a className = "footer-link">INFO</a>
                        <a className = "footer-link">MENU</a>
                        <a className = "footer-link">REVIEWS</a>
                    </div>
                </div>
                <div className = "footer-grid-item">
                    <h1 className = "footer-header">Find us</h1>
                    <WrappedMap 
                        googleMapURL="https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places"
                        loadingElement={<div style={{ height: `1000px` , width : '1000px' }} />}
                        containerElement={<div style={{ height: `400px` }} />}
                        mapElement={<div style={{height: `1000px`, width: `1000px`}} />} 
                    />
                </div>
                <div className = "footer-grid-item">
                <h1 className = "footer-header">Social</h1>
                </div>
            </div>
            <div className = "footer-line"></div>
            <div className = "footer-copyright">
                <h1 className = "copyright-text">&copy;Pasterino - all right reserved</h1>
            </div>
        </div>
    );
}

export default Footer;
